// Libraries
import React from "react";
// Components
import HomePage from "./pages/HomePage";
// Data
import data from "./data/store-items.json";

class App extends React.Component {
  state = {
    clothes: data,
  };
  render() {
    return <HomePage clothes={this.state.clothes} />;
  }
}

export default App;
